import React from 'react';
import closeButton from '../images/formclosebutton.svg';

function PopupWithForm(props, isOpen) {
  return (
    <>
      <div
        className={`popup popup_${props.name} ${isOpen ? 'popup_hide' : ''} `}
      >
        <button type="button" className="popup__close-button">
          <img src={closeButton} alt="close Button" />
        </button>
        <form
          className={`popup__content popup__content_${props.name}`}
          /* novalidate */
        >
          <h4 className="popup__title">${props.title}</h4>
          {props.children}
          <button
            className={`popup__save-button popup__save-button_${props.name}`}
            /* disabled */ type="submit"
          >
            Guardar
          </button>
        </form>
      </div>
    </>
  );
}

export default PopupWithForm;
